import React from 'react';
import style from './Footer_About.module.css';

export const Footer_About = (props) => {

    return (
        <div className={style.about}>
            <div className={style.title}>
                <img src={props.image} className={style.icon}/>
                <p>{props.textTitle}</p>
            </div>
            <p>{props.text}</p>
        </div>
    )
}
